class Solution:
    def subtractProductAndSum(self, n: int) -> int:
        digits = []
        while n > 0:
            digits.append(n%10)
            n //= 10
        prod = 1
        for n in digits:
            prod *= n
        summ = 0
        for n in digits:
            summ += n
        return prod - summ

class Solution:
    def subtractProductAndSum(self, n: int) -> int:

        str_n = list(str(n))

        product = 1

        for char in str_n:
            product *= int(char)

        acc = 0

        for char in str_n:
            acc += int(char)

        return product - acc

